import React, { Component } from 'react';
import './App.css';

class App extends Component {

  state = {
    data: [],
    nutrientdata: []
  }

  componentDidMount(){
    fetch('https://api.nal.usda.gov/ndb/reports/?ndbno=01009&type=f&format=json&api_key=DEMO_KEY')
    .then(resp=>resp.json())
    .then(resp=>{
      // console.log(resp);
      this.setState({
        data: resp.report.food
      })      
    })

    fetch('https://api.nal.usda.gov/ndb/nutrients/?format=json&api_key=DEMO_KEY&nutrients=205&nutrients=204&nutrients=208&nutrients=269&ndbno=01009')
    .then(resp=>resp.json())
    .then(resp=>{
      console.log(resp);
      this.setState({
        nutrientdata: resp
      })      
    })
  }

  render() {
    console.log(`state:`, this.state.data);
    const { data, nutrientdata } = this.state;
    return (
      <div className="App">
        <header className="App-header">
          <h1>USDA</h1>
        </header>
        <main>
          <div className="display" style={{ width: '500px', height: '300px'}}>
            <h2>{data.name}</h2>
            <p>{data.fg}</p>
            <p>{nutrientdata}</p>
          </div>
        </main>
      </div>
    );
  }
}

export default App;
